import React, { useState, useEffect } from 'react';
import styled, { keyframes } from 'styled-components';
import { Link } from 'react-router-dom';

import poster from './assets/bummy.png';

function Lending() {
  return (
    <Container>
      <Poster src={poster} alt="방탈출 게임 포스터"></Poster>
      <HintButtonBox>
        <HintButton>
          <Link to="/Hint1" style={{ textDecoration: 'none', color: 'black' }}>
            지령1
          </Link>
        </HintButton>
        <HintButton>
          {' '}
          <Link to="/Hint2" style={{ textDecoration: 'none', color: 'black' }}>
            지령2
          </Link>
        </HintButton>
      </HintButtonBox>
      <HintButtonBox>
        <HintButton>
          {' '}
          <Link to="/Hint3" style={{ textDecoration: 'none', color: 'black' }}>
            지령3
          </Link>
        </HintButton>
        <HintButton>
          {' '}
          <Link to="/Hint4" style={{ textDecoration: 'none', color: 'black' }}>
            지령4
          </Link>
        </HintButton>
      </HintButtonBox>
      <HintButtonBox>
        <HintButton>
          {' '}
          <Link to="/Hint5" style={{ textDecoration: 'none', color: 'black' }}>
            지령5
          </Link>
        </HintButton>
        <HintButton>
          {' '}
          <Link to="/Hint6" style={{ textDecoration: 'none', color: 'black' }}>
            지령6
          </Link>
        </HintButton>
      </HintButtonBox>
      <HintButtonBox>
        <HintButton>
          {' '}
          <Link to="/Hint7" style={{ textDecoration: 'none', color: 'black' }}>
            지령7
          </Link>
        </HintButton>
        <HintButton>
          {' '}
          <Link to="/Hint8" style={{ textDecoration: 'none', color: 'black' }}>
            지령8
          </Link>
        </HintButton>
      </HintButtonBox>
      <HintButtonBox>
        <HintButton>
          {' '}
          <Link to="/Hint9" style={{ textDecoration: 'none', color: 'black' }}>
            지령9
          </Link>
        </HintButton>
        <HintButton>
          {' '}
          <Link to="/Hint10" style={{ textDecoration: 'none', color: 'black' }}>
            지령10
          </Link>
        </HintButton>
      </HintButtonBox>
      <HintButtonBox>
        <HintButton>
          {' '}
          <Link to="/Test" style={{ textDecoration: 'none', color: 'black' }}>
            TEST
          </Link>
        </HintButton>
      </HintButtonBox>
    </Container>
  );
}

const Container = styled.div`
  max-width: 100vw;
  min-height: 100vh;
  background-color: #0e0e0e;
  color: #ffffff;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: flex-start;
  position: relative;
`;

const Poster = styled.img`
  width: 100vw;
  height: 100vw;
  margin-top: 62px;
  margin-bottom: 62px;
  @media (min-width: 430px) {
    width: 400px;
    height: 400px;
  }
`;

const HintButtonBox = styled.div`
  max-width: 100vw;
  background-color: #0e0e0e;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: flex-start;
  position: relative;
`;

const HintButton = styled.button`
  width: 100px;
  height: 50px;
  background-color: white;
  margin: 20px;
`;

export default Lending;
